import React from 'react'
import './CSS/Global-Blogs.css'
import './CSS/Homepage.css'
const Blogs = () => {
    return (
        <>
            <div className="Body" id='B-Body'>
                <div className="B-TopBTNS">
                    <a href='/' type="button"  class="btn btn-dark B-HOME">Home</a>
                </div>
                div.B-TopHead
            </div>
        </>
    )
}

export { Blogs }
